import React, { useEffect } from "react";

/**
 * Props:
 * - movie: object film (imdbID, Title, Year, Poster, imdbRating, Genre, Plot, dll)
 * - onClose(): function untuk menutup modal/card
 * - onToggleFav(movie): toggle favorite
 * - isFav: boolean, apakah film sudah favorit
 */
export default function DetailCard({ movie, onClose, onToggleFav, isFav = false }) {
  useEffect(() => {
    function onKey(e) {
      if (e.key === "Escape") onClose();
    }
    document.addEventListener("keydown", onKey);
    return () => document.removeEventListener("keydown", onKey);
  }, [onClose]);

  if (!movie) return null;

  return (
    <div className="modal-overlay" role="dialog" aria-modal="true" aria-label={`Detail ${movie.Title}`} onClick={onClose}>
      <div className="modal detail-card" onClick={(e) => e.stopPropagation()}>
        <button className="modal-close" onClick={onClose} aria-label="Tutup detail">✕</button>

        <div className="detail-grid">
          <div className="detail-poster">
            <img
              src={movie.Poster && movie.Poster !== "N/A" ? movie.Poster : "https://via.placeholder.com/300x450?text=No+Image"}
              alt={`${movie.Title} poster`}
              width="300"
              height="450"
            />
          </div>

          <div className="detail-meta">
            <h2 className="detail-title">
              {movie.Title} <small className="muted">({movie.Year})</small>
            </h2>

            <div className="meta-row">
              <div className="meta-pill">Rating: <strong>{movie.imdbRating || "N/A"}</strong></div>
              {movie.Runtime && <div className="meta-pill">Durasi: {movie.Runtime}</div>}
              {movie.Genre && <div className="meta-pill">Genre: {movie.Genre}</div>}
            </div>

            {movie.Plot && <p className="plot">{movie.Plot}</p>}

            <div className="detail-actions">
              <button
                className={`btn ${isFav ? "danger" : ""}`}
                onClick={() => onToggleFav(movie)}
                aria-pressed={isFav}
              >
                {isFav ? "Hapus dari Favorit" : "Tambah ke Favorit"}
              </button>

              <a
                className="btn ghost"
                href={`https://www.imdb.com/title/${movie.imdbID}`}
                target="_blank"
                rel="noreferrer"
                onClick={(e) => e.stopPropagation()}
              >
                Lihat di IMDb
              </a>

              <button className="btn" onClick={onClose}>Tutup</button>
            </div>

            <div className="extra-info">
              {movie.Director && <div><strong>Director:</strong> {movie.Director}</div>}
              {movie.Actors && <div><strong>Actors:</strong> {movie.Actors}</div>}
              {movie.Language && <div><strong>Language:</strong> {movie.Language}</div>}
              {movie.Country && <div><strong>Country:</strong> {movie.Country}</div>}
              {movie.Released && <div><strong>Released:</strong> {movie.Released}</div>}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
